import React from "react";

const Input = () => {
        const [list, setList] = React.useState([1, 2, 3]) //0: active, 1: completed

        return(
            <>
                <input onClick={() => {setList([...list, 4])}} placeholder='Add todo'/>
                        {list.map((el) => {
                                return (
                                    <li>{el}</li>
                                )
                        })}
             </>
        )
}

export default Input;
